import React, { useState } from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Nav from './components/navbar/nav';
import Welcom from './components/welcoming/welcom';
import Cards from './components/cards/cards';

function App() {
  const [movies, setMovies] = useState([]); // Manage state in App.js

  return (
    <div>
      <Nav />
      <Welcom setMovies={setMovies} /> {/* Pass setMovies to Welcom.jsx */}
      <Cards movies={movies} /> {/* Pass movies to Cards.jsx */}
    </div>
  );
}

export default App;
